//该文件专门用于创建整个应用的路由器
import VueRouter from "vue-router"
import About from "../components/HelloWorld"
import Test from "../components/TestPageVue"

export default new VueRouter({
    routes:[
        {path:"/about",
        component:About},
        {path:"/test",
        component: Test},
    ]
})
